(590, 11, 'step_one_title', 'CAPTAÇÃO'),
(591, 11, '_step_one_title', 'field_5eb99cf45fad3'),
(592, 11, 'step_one_description', 'Nessa fase, a luz solar que reflete e é captada nas células fotovoltáicas da placas que ficam no seu telhado ou na área escolhida para a montagen dos paineis, são convertidas em energia elétrica de corrente contínua.'),
(593, 11, '_step_one_description', 'field_5eb99cfb5fad4'),
(594, 11, 'step_one_image', '129'),
(595, 11, '_step_one_image', 'field_5eb99d055fad5'),
(596, 11, 'step_one', ''),
(597, 11, '_step_one', 'field_5eb99c675fad2'),
(598, 11, 'step_two_title', 'CONVERSÃO'),
(599, 11, '_step_two_title', 'field_5eb99d1d5fad7'),
(600, 11, 'step_two_description', 'Através do inversor, a energia elétrica corrente contínua é transformada em corrente alternada, que é uma corrente compatível com a rede elétrica. o inversor fica conectado diretamente com o quadro geral da residência.'),
(601, 11, '_step_two_description', 'field_5eb99d1d5fad8'),
(602, 11, 'step_two_image', '132'),
(603, 11, '_step_two_image', 'field_5eb99d1d5fad9'),
