(607, 11, '_step_three_title', 'field_5eb99d315fae3');
INSERT INTO `wp_postmeta` (`meta_id`, `post_id`, `meta_key`, `meta_value`) VALUES
(608, 11, 'step_three_description', 'Sobre o armazenamento, pode ser feito por baterias, entretanto, no Brasil, o sitema mais comum e mais acessível, trata de liberar a energia excedente produzida e não utilizada na rede de energia da concessionária.'),
(609, 11, '_step_three_description', 'field_5eb99d315fae4'),
(610, 11, 'step_three_image', '131'),
(611, 11, '_step_three_image', 'field_5eb99d315fae5'),
(612, 11, 'step_three', ''),
(613, 11, '_step_three', 'field_5eb99d315fae2'),
(614, 11, 'step_four_title', 'ACOMPANHAMENTO'),
(615, 11, '_step_four_title', 'field_5eb99d2e5fadf'),
(616, 11, 'step_four_description', 'Sabendo que haverá excedente de geração, você pode acompanhar o quanto de energia irá para a rede elétrica da concessionária através da tela do seu inversor ou mesmo do medidor, podendo saber o quanto de energia vc consumiu e o quanto injetou na rede, sabendo que o excedente será transformado em crédito para serem utilizadosnas próximas faturas.'),
(617, 11, '_step_four_description', 'field_5eb99d2e5fae0'),
